import "./styles.css";

export default function App() {
  return (
    <div className="App">
        <nav className="navbar navbar-expand-sm bg-dark sticky-top">
            <div className="container-fluid">
    <Logo ></Logo>
    </div>
                </nav>
           <div style={{width: 'auto', height: 'auto' }} className=" p-5 bg-primary text-white rounded">
      <h1>Explore the web with a new horizon</h1>
      <h2></h2>

          <Horizon></Horizon> <br></br>
          <button className="btn btn-dark"></button>
          </div>

      </div>
  );
}

export function Horizon() {
  return (
    <img style={{width: '200px' }}
      src="brand/PhoenixHorizon.webp"
      alt="Horizon logo"
    />
  )
}
export function Logo() {
  return (
    <img style={{width: '200px' }}
      src="brand/phoenixwhite.webp"
      alt="Horizon logo"
    />
  )
}
